Actionscript.script:
if (!_parent.回归枢机之光发射数)
{
	_parent.回归枢机之光发射数 = 0;
}
_parent.回归枢机之光发射数 ++;

if (_parent.性别 == "男")
{
	_root.播放音效("回归枢机之光人声.wav");
}

onClipEvent (load) {
	子弹属性 = _root.子弹属性初始化(this);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 3;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战联弹";

	自机 = _root.获得父节点(this, 2);
	子弹属性.子弹威力 = 自机.空手攻击力 * 0.1 + 自机.等级 * 25 + 自机.内力 * 15;

	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 50;
	子弹属性.击倒率 = 0.01;
	子弹属性.伤害类型 = "真伤";
	子弹属性.血量上限击溃 = 1;

	子弹属性.区域定位area = this.area;
	_root.子弹区域shoot传递(子弹属性);
}

onClipEvent (load) {
	子弹属性 = _root.子弹属性初始化(this);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 3;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战联弹";

	自机 = _root.获得父节点(this, 2);
	子弹属性.子弹威力 = 自机.空手攻击力 * 0.1 + 自机.等级 * 25 + 自机.内力 * 15;

	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 50;
	子弹属性.击倒率 = 0.01;
	子弹属性.伤害类型 = "真伤";
	子弹属性.血量上限击溃 = 1;

	子弹属性.区域定位area = this.area;
	_root.子弹区域shoot传递(子弹属性);
}

onClipEvent (load) {
	_parent._parent.skillShadow = this;
	if (!_root.是否阴影)
	{
		this._visible = false;
	}
	缩放乘数 = 3.611 * 175 / _parent._parent.身高;
	if (_parent._parent.技能浮空 == true)
	{
		if (_parent._parent.浮空)
		{
			this._y = 233.05 + (_parent._parent.起始Y - _parent._parent._y - _parent._parent.垂直速度) * 缩放乘数;
		}
	}
}
onClipEvent (enterFrame) {
	if (_root.是否阴影 and (_parent._parent.浮空 or (_parent._parent.技能浮空 == true)))
	{
		this._y = 233.05 + (_parent._parent.起始Y - _parent._parent._y - _parent._parent.垂直速度) * 缩放乘数;
	}
	else
	{
		this._y = 233.05;
	}
}
